    <style>
      * {
        box-sizing: border-box;
      }

      body {
        margin: 0;
        font-family: Arial;
        font-size: 17px;
      }

      #myVideoOld {
        position: fixed;
        right: 0;
        bottom: 0;
        min-width: 100%; 
        max-height: 100%;
      }

      #loopVideo11 {
        position: fixed;
        top: 0;
        /*right: 0;*/
        bottom: 0;
        left: -30%;
        height: 100%;
        min-width: 100%;
      }

      .content {
        position: fixed;
        bottom: 0;
        background: rgba(0, 0, 0, 0.5);
        color: #f1f1f1;
        width: 100%;
        padding: 20px;
      }

      .allscreen {
        position: absolute;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        height: 100%;
        width: 100%;
      }

      #Packshot {
        width: 100%;
        height: 100%;
        object-fit: cover;
        object-position: 50% 60%;
        opacity: 0;
      }

      #allscreenBtn {
        width: 100%;
        height: 100%;
        font-size: 18px;
        padding: 10px;
        border: none;
        background: rgba(0, 0, 0, 0);
        color: rgba(0, 0, 0, 0);
        cursor: pointer;
      }

      #JoystickBack {
        position: fixed;
        width: 20%;
        bottom: 12%;
        left: 41%;
        opacity: 0;
      }

      #JoystickCenter {
        position: fixed;
        opacity: 0;
      }

      #TutorHand {
        position: fixed;
        opacity: 0;
      }

      #CtaLogo {
        position: fixed;
        width: 12%;
        bottom: 2%;
        left: 3%;
      }

      #CtaDownload {
        position: fixed;
        width: 12%;
        bottom: 2%;
        right: 3%;
      }

      #CtaDownloadButton {
        position: fixed;
        appearance: none;
        border: none;
        background: rgba(0, 0, 0, 0);
        color: rgba(0, 0, 0, 0);
        cursor: pointer;
      }

      #CoinCounter {
        position: fixed;
        width: 30%;
        top: 2%;
        right: 5%;
      }

      #LoadingBack {
        position: absolute;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        height: 100%;
        min-width: 100%;
        z-index: 100;
      }

      #LoadingLogo {
        position: fixed;
        width: 30%;
        bottom: 45%;
        left: 35%;
        z-index: 101;
      }

    </style>
